import React from "react";

function Signup() {
    return (
        <div className="popup">
            <div className="close-btn">&times;</div>
            <div className="form">
                <h2>Log In</h2>
                <div className="form-element">
                    <label for="email">Email</label>
                </div>
            </div>

        </div>
    );
}

export default Signup;
